import React, { useState, useEffect } from 'react';
import {
  Typography, Button, Paper, Grid, Card, CardContent,
  CardActions, TextField, Dialog, DialogTitle, DialogContent,
  DialogActions, Divider, Box
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import StoreIcon from '@mui/icons-material/Store';
import { shopService, carService } from '../services/api';

const ShopsPage = () => {
  const [shops, setShops] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [openDialog, setOpenDialog] = useState(false);
  const [shopName, setShopName] = useState('');
  const [shopCars, setShopCars] = useState({});

  useEffect(() => {
    loadShops();
  }, []);

  const loadShops = async () => {
    setLoading(true);
    try {
      const response = await shopService.getAllShops();
      setShops(response.data);
      
      // Загрузим статистику по автомобилям для каждого магазина
      loadCarsPerShop(response.data);
    } catch (err) {
      setError('Ошибка при загрузке списка магазинов');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const loadCarsPerShop = async (shopsList) => {
    try {
      const response = await carService.getAllCars();
      const allCars = response.data;
      
      // Формируем объект с информацией о количестве автомобилей для каждого магазина
      const carsPerShop = {};
      
      shopsList.forEach(shop => {
        // Фильтруем автомобили для текущего магазина
        const shopCars = allCars.filter(car => car.shopId === shop.id);
        
        // Считаем общую стоимость автомобилей
        const totalPrice = shopCars.reduce((sum, car) => sum + car.price, 0);
        
        // Считаем новые машины и с пробегом
        const newCars = shopCars.filter(car => car.condition === 'новая').length;
        const usedCars = shopCars.filter(car => car.condition !== 'новая').length;
        
        carsPerShop[shop.id] = {
          total: shopCars.length,
          newCount: newCars,
          usedCount: usedCars,
          totalPrice
        };
      });
      
      setShopCars(carsPerShop);
    } catch (err) {
      console.error('Ошибка при загрузке статистики автомобилей', err);
    }
  };

  const handleOpenDialog = () => {
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setShopName('');
  };

  const handleNameChange = (e) => {
    setShopName(e.target.value);
  };

  const handleAddShop = async () => {
    if (!shopName.trim()) return;
    
    try {
      await shopService.createShop({ name: shopName });
      setShopName('');
      setOpenDialog(false);
      loadShops(); // Перезагрузим список магазинов
    } catch (err) {
      console.error('Ошибка при добавлении магазина', err);
    }
  };

  return (
    <div>
      <Typography variant="h4" component="h1" className="page-title">
        Магазины
      </Typography>

      <div className="action-buttons">
        <Button 
          variant="contained" 
          color="primary" 
          startIcon={<AddIcon />}
          onClick={handleOpenDialog}
        >
          Добавить магазин
        </Button>
      </div>

      {loading ? (
        <Typography>Загрузка...</Typography>
      ) : error ? (
        <Typography color="error">{error}</Typography>
      ) : shops.length === 0 ? (
        <Paper sx={{ p: 4, textAlign: 'center' }}>
          <StoreIcon fontSize="large" color="action" sx={{ mb: 2, fontSize: 60, opacity: 0.3 }} />
          <Typography variant="h6">Нет магазинов для отображения</Typography>
          <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
            Добавьте первый магазин, чтобы начать работу с системой
          </Typography>
          <Button 
            variant="contained" 
            color="primary" 
            startIcon={<AddIcon />}
            onClick={handleOpenDialog}
            sx={{ mt: 2 }}
          >
            Добавить магазин
          </Button>
        </Paper>
      ) : (
        <Grid container spacing={3}>
          {shops.map((shop) => (
            <Grid item xs={12} md={4} key={shop.id}>
              <Card>
                <CardContent>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    <StoreIcon color="primary" sx={{ mr: 1 }} />
                    <Typography variant="h6">
                      {shop.name}
                    </Typography>
                  </Box>
                  
                  <Divider sx={{ mb: 2 }} />
                  
                  {shopCars[shop.id] ? (
                    <Grid container spacing={2}>
                      <Grid item xs={6}>
                        <Typography variant="body2" color="text.secondary">
                          Всего автомобилей
                        </Typography>
                        <Typography variant="h6">
                          {shopCars[shop.id].total} шт.
                        </Typography>
                      </Grid>
                      <Grid item xs={6}>
                        <Typography variant="body2" color="text.secondary">
                          Общая стоимость
                        </Typography>
                        <Typography variant="h6">
                          {shopCars[shop.id].totalPrice.toLocaleString()} ₽
                        </Typography>
                      </Grid>
                      <Grid item xs={6}>
                        <Typography variant="body2" color="text.secondary">
                          Новых
                        </Typography>
                        <Typography variant="body1">
                          {shopCars[shop.id].newCount} шт.
                        </Typography>
                      </Grid>
                      <Grid item xs={6}>
                        <Typography variant="body2" color="text.secondary">
                          С пробегом
                        </Typography>
                        <Typography variant="body1">
                          {shopCars[shop.id].usedCount} шт.
                        </Typography>
                      </Grid>
                    </Grid>
                  ) : (
                    <Typography variant="body2" color="text.secondary">
                      Загрузка данных...
                    </Typography>
                  )}
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      )}

      {/* Диалог добавления магазина */}
      <Dialog open={openDialog} onClose={handleCloseDialog} maxWidth="sm" fullWidth>
        <DialogTitle>Добавить новый магазин</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Название магазина"
            type="text"
            fullWidth
            value={shopName}
            onChange={handleNameChange}
            sx={{ mt: 1 }}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog}>Отмена</Button>
          <Button 
            onClick={handleAddShop} 
            variant="contained" 
            color="primary"
            disabled={!shopName.trim()}
          >
            Добавить
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
};

export default ShopsPage;
